import React from 'react';
import { useNavigate } from 'react-router-dom';

const LandingPage = () => {
  const navigate = useNavigate();

  const goToRolesPage = () => {
    navigate('/login/roles');
  };

  return (
    <div className="container" style={styles.container}>
      {/* Header Section */}
      <div style={styles.welcomeSection}>
        <h1 style={styles.title}>Welcome to Quantum Drug Design</h1>
        <p style={styles.subtitle}>
          A platform dedicated to molecule management, clinical analysis, and scientific development.
        </p>
      </div>

      {/* Features Section */}
      <div style={styles.featuresSection}>
        <h2 className="section-title">Our Features</h2>
        <div style={styles.featureCards}>
          {/* Clickable Card */}
          <div
            style={{ ...styles.featureCard, cursor: 'pointer' }}
            onClick={goToRolesPage}
          >
            <h3 style={styles.featureHeader}>Multi-Role Authentication</h3>
            <p style={styles.featureDescription}>
              Secure access for Admins, Chemists and Pharmacists.
            </p>
          </div>

          {/* Other static cards */}
          <div style={styles.featureCard}>
            <h3 style={styles.featureHeader}>3D Visualization</h3>
            <p style={styles.featureDescription}>
              Explore molecular structures in precise 3D detail.
            </p>
          </div>
          <div style={styles.featureCard}>
            <h3 style={styles.featureHeader}>Graph Analysis</h3>
            <p style={styles.featureDescription}>
              Interactive graphs to analyze scientific data.
            </p>
          </div>
          <div style={styles.featureCard}>
            <h3 style={styles.featureHeader}>Model Monitoring</h3>
            <p style={styles.featureDescription}>
              Monitor the performance of AI/ML models in real-time.
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

// Styles
const styles = {
  container: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    minHeight: '100vh',
    backgroundColor: '#f2f2f2',
    padding: '20px',
  },
  welcomeSection: {
    backgroundColor: '#fff',
    padding: '40px',
    borderRadius: '10px',
    boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
    marginBottom: '40px',
    textAlign: 'center',
    width: '100%',
    maxWidth: '800px',
  },
  title: {
    fontSize: '2.5rem',
    fontWeight: 'bold',
    color: '#6a0dad',
  },
  subtitle: {
    fontSize: '1.2rem',
    color: '#0044cc',
    marginTop: '10px',
    marginBottom: '30px',
  },
  featuresSection: {
    maxWidth: '1000px',
    width: '100%',
    padding: '20px 0',
  },
  featureCards: {
    display: 'flex',
    flexWrap: 'wrap',
    gap: '20px',
    justifyContent: 'center',
  },
  featureCard: {
    flex: '1 1 200px',
    maxWidth: '280px',
    minHeight: '200px',
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'center',
    backgroundColor: '#e6e6e6',
    borderRadius: '10px',
    padding: '20px',
    textAlign: 'center',
  },
  featureHeader: {
    fontSize: '1.3rem',
    fontWeight: 'bold',
    color: '#6a0dad',
  },
  featureDescription: {
    fontSize: '1rem',
    color: '#333',
    marginTop: '10px',
  },
};

export default LandingPage;
